import React, { useState } from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEnvelope, faUser, faUnlockAlt } from "@fortawesome/free-solid-svg-icons";




function Card(props) {
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [email, setEmail] = useState('');

  const handleAddClick = () => {
    if (name && age && email) {
      props.onAdd({ name, age, email });
      setName('');
      setAge('');
      setEmail('');
    }
  };

  const [selectedAccount, setSelectedAccount] = useState('Personal');

  const handleAccountChange = (event) => {
    setSelectedAccount(event.target.value);
  };

  return (
    <div className="main-block">
      <h1>Registration</h1>
      <form action="/">
        <hr />
        <div className="account-type">
          <label htmlFor="radioOne" className="radio">
            <input
              type="radio"
              value="Personal"
              id="radioOne"
              name="account"
              checked={selectedAccount === 'Personal'}
              onChange={handleAccountChange}
            />
            Personal
          </label>
          <label htmlFor="radioTwo" className="radio">
            <input
              type="radio"
              value="Company"
              id="radioTwo"
              name="account"
              checked={selectedAccount === 'Company'}
              onChange={handleAccountChange}
            />
            Company
          </label>
        </div>
        <hr />
        <label id="icon" htmlFor="name">
          <i className="fas fa-envelope"></i>
        </label>
        <input type="text" name="name" id="name" placeholder="Email" required />
        <label id="icon" htmlFor="username">
          <i className="fas fa-user"></i>
        </label>
        <input type="text" name="username" id="username" placeholder="Username" required />
        <label id="icon" htmlFor="password">
          <i className="fas fa-lock"></i>
        </label>
        <input type="password" name="password" id="password" placeholder="Password" required />
        <hr />
        <div className="gender">
          <input type="radio" value="Male" id="male" name="gender" defaultChecked />
          <label htmlFor="male" className="radio">Male</label>
          <input type="radio" value="Female" id="female" name="gender" />
          <label htmlFor="female" className="radio">Female</label>
        </div>
        <hr />
        <div className="btn-block">
          <button type="submit" href="/">Register</button>
        </div>
      </form>
    </div>
  );
}

function App() {
  const [cards, setCards] = useState([]);

  const handleAddCard = (cardData) => {
    setCards([...cards, cardData]);
  };

  const handleDeleteCard = (index) => {
    setCards(cards.filter((_, i) => i !== index));
  };

  return (
    <div className="app">
      <Card onAdd={handleAddCard} />
      {cards.map((card, index) => (
        <div key={index} className="card">
          <div>Name: {card.name}</div>
          <div>Age: {card.age}</div>
          <div>Email: {card.email}</div>
          <button onClick={() => handleDeleteCard(index)}>x</button>
        </div>
      ))}
    </div>
  );
}

export default App;
